    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    nums = list(range(1, 25))
    valid_selections = []

    def is_valid_circle(selection):
        for i in range(len(selection)):
            if gcd(selection[i], selection[(i + 1) % len(selection)]) != 1:
                return False
        return True

    def find_combinations(current_selection, remaining_nums):
        if not remaining_nums:
            if is_valid_circle(current_selection):
                valid_selections.append(current_selection[:])
        else:
            for num in remaining_nums:
                if not current_selection or gcd(current_selection[-1], num) == 1:
                    find_combinations(current_selection + [num], [x for x in remaining_nums if x != num])

    find_combinations([], nums)
    max_length = max(len(selection) for selection in valid_selections)
    return max_length

