    probabilities = {'A': 0.5, 'B': 0.4, 'C': 0.2}
    pass_fail = [1, 0]  # 1 for pass, 0 for fail

    # Generate all possible combinations of pass/fail for A, B, C
    scenarios = list(product(pass_fail, repeat=3))

    # Count passing students for each scenario and multiply by respective probabilities
    counts = {0: 0, 1: 0, 2: 0, 3: 0}
    for scenario in scenarios:
        count_pass = sum(scenario)
        scenario_prob = 1
        for i, result in enumerate(scenario):
            if result == 1:
                scenario_prob *= list(probabilities.values())[i]
            else:
                scenario_prob *= 1 - list(probabilities.values())[i]
        counts[count_pass] += scenario_prob

    # Find the number of pass students with the highest probability
    most_likely_pass = max(counts, key=counts.get)

    return most_likely_pass

ans = solution()

