    # where 3 is the smallest number that is within the 4 difference limit from 7
    # But since it's a three-digit number, the smallest other number we should consider is actually 0.
    # We are looking for the smallest 3-digit number which means the leftmost digit should be the smallest possible.
    # Starting from the smallest possible digit which is '0' and we will exclude '7' since '7' should be one of the digits.
    for x in range(0, 10):
        if x == 7:
            continue  # Skip 7 as it's already one of the digits
        for y in range(0, 10):
            if y == 7:
                continue  # Skip 7 as it's already one of the digits
            if 0 <= abs(x - 7) <= 4 and 0 <= abs(y - 7) <= 4 and 0 <= abs(x - y) <= 4:
                # Construct a number with x as the smallest digit on the left, y in the middle, and 7 as one of the digits.
